import styled from "styled-components";

import { Grid } from "@material-ui/core";

export const SignUpContainer = styled(Grid)`
  display: flex;
  flex-direction: column;
  width: 380px;
`;

export const TitleContainer = styled.h2`
  margin: 10px 0;
`;
